function get_iceberg_crm_callback_link() {
    global $wpdb;
    $table_name = $wpdb->prefix . "iceberg_crm_callback_links";
    $query = "SELECT link FROM $table_name LIMIT 1";
    $result = $wpdb->get_var($query);
    return $result;
}


